import React from "react";
import "./CreateAd.css";

function CreateAd(props) {
  return (
    <form>
      <label>Name</label>
      <label>Address</label>
      <input name="address" />
      <label>Date</label>
      <input name="date" type="date" />
      <label>Order Number</label>
      <input name="order" />
      <input type="submit" />
    </form>
  );
}

export default CreateAd;
